(1, 'Spring Forward in 2023', 'Spring Forward in 2023', 3, 0, 10, 'IMG-642af7c8612943.70356826.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 0in; margin-top: 0in; mso-margin-bottom-alt: 8.0pt; mso-margin-top-alt: 0in; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 14.0pt; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Harper Woods Residents&hellip; <strong><em>Spring is the Time for Renewal! </em></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; margin-top: 0in; mso-margin-bottom-alt: 8.0pt; mso-margin-top-alt: 0in; mso-add-space: auto; line-height: normal;\"><span style=\"font-size: 14.0pt; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; margin-top: 0in; mso-margin-bottom-alt: 8.0pt; mso-margin-top-alt: 0in; mso-add-space: auto; text-indent: .5in; line-height: normal;\"><span style=\"font-size: 14.0pt; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Let&rsquo;s work together to reinforce our community&rsquo;s spirit. Please show your support and involvement as a resident<em>- by making efforts to keep our City clean and harmonious this spring</em>. Many of have neighbors that are seniors and need your assistance in maintaining their properties- <em>lend a helping hand</em>. Get outside and enjoy the fresh air- <em>visit one of our three city parks to experience many of the new improvements and outdoor activities they have to offer!</em></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-indent: .5in;\"><span style=\"font-size: 14.0pt; line-height: 107%; mso-ascii-font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">In the last year the City focused on increasing recreational areas and activities for residents. Some of the park improvements include new basketball courts, benches, bike racks, drinking fountains, signs, and corn hole game boards. Renovations were made to restrooms, picnic shelters and pickle ball and tennis courts. The extension of the walking track at Salter Park was also competed. New barbeque grills and outdoor chess/checkboard tables will be installed this year.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-indent: .5in;\"><span style=\"font-size: 14.0pt; line-height: 107%;\">Over the past several months City staff have also been planning and developing a new &ldquo;pocket&rdquo; park on a vacant publicly owned lot located at 20321 Roscommon Avenue. Pocket parks are typically no larger than half an acre and do not include larger amenities such as a basketball court or pavilion. This lot, due to its size and location, is ideal for a small, neighborhood park. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-indent: .5in;\"><span style=\"font-size: 14.0pt; line-height: 107%;\">We are seeking funding to complete the project from the Department of Natural Resources Sparks Grant program. The project was not among the 21 accepted projects out of more than 460 submitted from around the entire state in the first round of grants. It is however eligible for resubmission, and we look forward to improving on the initial application. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 14.0pt; line-height: 107%;\">More information and the opportunity to submit ideas and ask questions concerning this project can be found on the city&rsquo;s community engagement platform, <em>Engage Harper Woods</em>, at </span><a href=\"http://www.harperwoods.citizenlab.co\"><strong><span style=\"font-size: 14.0pt; line-height: 107%; color: windowtext; text-decoration: none; text-underline: none;\">www.harperwoods.citizenlab.co</span></strong></a><span style=\"font-size: 14.0pt; line-height: 107%;\">.</span></p>', '2023-07-13 19:45:56', '2023-04-03', '2023-12-31', 1),
(2, 'Employee in the Spotlight - Chris Skerritt', 'Employee in the Spotlight - Chris Skerritt', 3, 0, 10, 'IMG-642afe724b81a6.30818506.jpg', '<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif;\"><u><span style=\"font-size: 12pt; line-height: 107%;\">Employee in the Spotlight</span></u><span style=\"font-size: 12pt; line-height: 107%;\"> - </span><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12pt; line-height: 107%;\">Chris Skerritt </span></strong></span></p>\r\n<p style=\"margin: 0in; text-indent: .5in; line-height: 150%;\"><span style=\"font-family: helvetica, arial, sans-serif;\"><span style=\"color: rgb(32, 33, 36); background: white;\">Chris Skerritt was promoted to Parks and Recreation Director in fall of 2022 and is dedicated to the success of the Harper Woods community. Skerritt is responsible for the department&rsquo;s programming schedule and staffing, enhancing, and creating </span><span style=\"color: black;\">new opportunities that align with the community&rsquo;s wants and desires as well as maintaining the parks for the residents to enjoy. </span></span></p>\r\n<p style=\"margin: 0in; text-indent: .5in; line-height: 150%;\"><span style=\"font-family: helvetica, arial, sans-serif; color: rgb(32, 33, 36); background: white;\">Acting City Manager John Szymanski said, &ldquo;We are fortunate to have an innovator like Chris, she lives here, she works here. Her brilliant problem solving skills<span style=\"mso-spacerun: yes;\">&nbsp; </span>help us reach our targets more quickly!&rdquo;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-indent: .5in; line-height: 150%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: helvetica, arial, sans-serif;\">Chris said, &ldquo;I am honored and appreciative that I was chosen as the Employee in the Spotlight! <span style=\"mso-spacerun: yes;\">&nbsp;</span>I love that I have been given the opportunity to talk about our Parks and Recreation Department. I have lived in Harper Woods for 24 years. I started working for Parks and Recreation in early 2017 as an office assistant under Director John Bobak. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: .5in; line-height: 150%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: helvetica, arial, sans-serif;\">She expressed, &ldquo;What I like most about this position is the diversity that comes from this industry. Really, one day I can be counseling an employee, the next day I&rsquo;m overseeing a dance recital, or planning an event for the community. You never know from one day to the next what challenges may come forward.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Believe it or not, that&rsquo;s what makes this job interesting. Through strategic planning we get to see the evolution of our parks, programs, and services over time, which is so rewarding and important to the quality of life. I enjoy the opportunity to do something that directly affects people in a positive way. I hope that residents see and enjoy the many improvements we&rsquo;ve made in the parks.&rdquo;</span></p>', '2023-07-13 19:46:28', '2023-04-03', '2023-12-31', 1),
(5, 'Tim Hortons Opening Soon', 'Tim Hortons Opening Soon', 3, 0, 10, 'IMG-642b0a48da34b7.51149753.jpg', '<p class=\"MsoNormal\" style=\"line-height: 107%;\"><span style=\"font-size: 12.0pt; line-height: 107%; mso-bidi-font-weight: bold;\"><span style=\"mso-tab-count: 1;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 16.0pt; line-height: 106%;\">Tim Hortons Opening Soon</span></strong></span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"line-height: 1.5;\"><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Residents of Harper Woods, the City is working with Tim Hortons national headquarters and the new franchise owner to bring a brand-new Tim Hortons facility to our community. The old building was demolished, and a new more modern building has been constructed at Vernier and Beaconsfield. As you can see from the illustrated artist exterior rendering, the new building will have a smaller &ldquo;footprint&rdquo; on the site to make more available space for a patio with umbrella tables and new landscaping. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 0.5in; line-height: 1.5;\"><span style=\"font-size: 12pt; line-height: 106%; font-family: helvetica, arial, sans-serif;\">The new building design has no interior dinning. As illustrated in the rendering, customers will walk up to a serving window. What is not shown in the illustration is the outdoor sitting area with umbrella tables. Additionally, the new drive-through facilities will feature two lanes for placing orders, merging into one lane for payment and pick-up. This feature should reduce &ldquo;wait times&rdquo; in line for the morning rush-hour customers.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 1.5;\"><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>It is anticipated that reconstruction activities will be completed by March 2023.</span></p>', '2023-07-13 19:46:37', '2023-04-03', '2023-12-31', 1),
(7, 'Citizen Lab', 'Citizen Lab', 3, 0, 10, 'IMG-642b0f9969fc85.48228478.png', '<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-indent: .5in; line-height: normal; background: white;\"><span style=\"font-size: 14pt; color: black; font-family: helvetica, arial, sans-serif;\">In October 2022, the City became the first municipality in the State of Michigan to begin using an innovative community-engagement platform called CitizenLab. The platform is quickly becoming the \"one-stop shop\" for residents to find information related to projects and initiatives taking place in the City. The platform has also been used to allow residents to share ideas and take surveys, which has been especially helpful during the ongoing Master Plan update process. Future projects will also be calling on residents to share their thoughts and opinions on various projects and ideas.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; line-height: normal; background: white;\"><span style=\"font-size: 14pt; color: black; font-family: helvetica, arial, sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; text-indent: .5in; line-height: normal; background: white;\"><span style=\"font-size: 14pt; color: black; font-family: helvetica, arial, sans-serif;\">If you have not yet joined the platform, the QR code will direct you to the signup page. The link can also be found on the City website.&nbsp; </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 107%;\">&nbsp;</span></strong></span></p>', '2023-07-13 19:46:39', '2023-04-03', '2023-12-31', 1),
(9, '2022 Beautification Award Winners', '2022 Beautification Award Winners', 3, 0, 10, 'IMG-642b12edbb07c4.41880424.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 0in; line-height: normal;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\">The Harper Woods Beautification Commission distributed awards to the following recipients:</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; line-height: normal;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\">Bryan &amp; Lauren Ball, Mrs. Marguerite Forrest, Dan &amp; Fran Schmitt, James &amp; Britanny Smith, <span style=\"mso-spacerun: yes;\">&nbsp;</span>James &amp; Adrienne Strubank, and Sir Speedy-Harper Woods. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; line-height: normal;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in; line-height: normal;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\">Congratulations to the recipients and <strong>&ldquo;Thank You All&rdquo;</strong> for keeping Harper Woods beautiful!<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif;\"><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 9.0pt; line-height: 107%;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span></em></span></p>\r\n<p class=\"MsoNormal\"><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 9.0pt; line-height: 107%;\">&nbsp;</span></em></p>', '2023-07-13 19:46:42', '2023-04-03', '2023-12-31', 1),
(10, 'Community Swearing in Ceremony', 'Swearing in Ceremony', 3, 0, 10, 'IMG-642b1c4a0bf051.10358054.jpg', '<p class=\"MsoNormal\" style=\"text-indent: .5in;\"><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\">For the first time in the history of Harper Woods, an official <em>Community Swearing in Ceremony of State Representatives </em>was held at City Hall on December 20, 2022.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes;\">&nbsp;</span>Lt. Governor Garlin Gilchrist II was on site to administer the oath of office as District 11 Representative Veronica Paiz, District 12 Representative Kimberly Edwards, and District 14 Representative Donovan McKinney were collectively sworn into their respective offices. House Speaker Joe Tate was also in attendance to add his support. <strong>Congratulations to All!</strong></span></p>', '2023-07-13 19:46:44', '2023-04-03', '2023-12-31', 1),
(11, 'Grosse Pointe Chamber of Commerce ', 'Grosse Pointe Chamber of Commerce', 3, 0, 10, 'IMG-642b205121bef2.64832934.jpg', '<p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\">&nbsp;</span><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\">A NEW YEAR, A NEW TEAM! </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in;\"><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\">The Chamber&rsquo;s Mission is to promote businesses and engage residents for a thriving community. We provide:</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in;\"><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0in;\"><strong><span style=\"font-size: 12pt; line-height: 107%; font-family: helvetica, arial, sans-serif;\">INFORMATION</span></strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom: 0in; mso-add-space: auto; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><span style=\"font-family: helvetica, arial, sans-serif;\"><!-- [if !supportLists]--><span style=\"font-size: 12pt; line-height: 107%;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font-style: normal; font-variant: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12pt; line-height: 107%;\">Directory listing membership</span></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom: 0in; mso-add-space: auto; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><span style=\"font-family: helvetica, arial, sans-serif;\"><!-- [if !supportLists]--><span style=\"font-