(12, 'Families Against Narcotics', 'Families Against Narcotics', 3, 0, 10, 'IMG-642b24ab5d9a71.51972911.jpg', '<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 14.0pt; line-height: 107%; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #303030; background: white;\">FAN&rsquo;s Run Drugs Out of Town 5K is June 17th!</span></strong></span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: rgb(48, 48, 48); background: white; font-family: helvetica, arial, sans-serif;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: rgb(48, 48, 48); background: white; font-family: helvetica, arial, sans-serif;\">Families Against Narcotics&rsquo; Run Drugs Out of Town 5K Run/Walk is a beloved community event. Each year, men, women, and children of all ages come out to support a common cause: to increase awareness of substance use disorder and help raise money to fund the many free programs FAN offers to the public. <span style=\"mso-bidi-font-weight: bold;\">The 15th annual Run Drugs Out of Town will take place on Saturday, June 17th, at 9:00 am, at Fraser High School.<strong> </strong></span>Join FAN for this fun, family-friendly event! Whether you run or walk as an individual or a team, sponsor the event, or simply make a donation, you&rsquo;ll be helping FAN help people across Michigan who have been impacted by the disease of addiction. Be part of the crowd. Be part of the pageantry. Be part of the solution. And help FAN Run Drugs Out of Town! For more info, go to familiesagainstnarcotics.org/rundrugsoutoftown.</span></p>', '2023-07-13 19:46:49', '2023-04-03', '2023-12-31', 1),
(13, 'Todays Health & Fitness', 'Todays Health & Fitness', 3, 0, 10, 'IMG-642b29771a36c5.39598940.jpg', '<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><strong>Spring into Fitness</strong></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\"><br>Finally, spring is here and you can just hear Mother Nature shout; READY, SET, GO! If you work out at a gym, it&rsquo;s nice to go there without the heavy coats and winter gear weighing you down. Walking or running outside is more invigorating. Spring heightens our motivation to be active with an eye on getting more fit. With the pandemic further behind us and the media encouraging all of us to develop a healthy lifestyle and make a change for the better, you&rsquo;d expect the streets, gyms, and studios to be busier than ever.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">That&rsquo;s what I was thinking until I ran across some fitness info that really surprised me.</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">From the Good Body, a group of health and wellbeing specialist that present researched articles, case studies and product reviews I found these recent statistics.</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">Just one in five US adults exercise each day</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">More than three quarters of children in the US are active for less than the recommended 60 minutes each day.</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">23.2% of adults meet the guidelines for both aerobic and <u>muscle strengthening</u>&nbsp;activity. Focusing on aerobic exercise only; it&rsquo;s 53.3%.</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">42.4% of adults in the US are classed as obese.</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">-The US department of Health and Human Services Guidelines for Physical Activity recommends adults get at least 150 to 300 minutes of moderate-intensity cardio each week along with&nbsp;two strength sessions.&nbsp;<strong>That&rsquo;s 25 minutes on the low end and about 50 minutes on the high end each day over 6 days.</strong>&nbsp;</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">That could be budgeted into 2 days strength and 4 days, cardio at the very least. Fewer than half of adults meet both of these recommendations according to the CDC.</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">Of those that do exercise, walking is the most popular and only 10% of the population practice yoga.&nbsp;</span></em></span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 14pt; font-family: helvetica, arial, sans-serif; color: black;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif; font-size: 14pt;\"><em><span style=\"color: black;\">So this spring, decide which side of these statistics you want to be on? That is the best place to start.&nbsp;</span></em></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong>&nbsp;</strong></p>', '2023-07-13 19:46:52', '2023-04-03', '2023-12-31', 1),
(14, 'Mayor-Manager Meeting Connects Officials', 'Mayor-Manager Meeting', 3, 0, 10, 'IMG-64357e2e2438c7.88906360.jpg', '<p class=\"MsoNormal\"><span style=\"font-family: helvetica, arial, sans-serif;\"><strong><span style=\"font-size: 12pt; line-height: 107%;\">Mayor-Manager Meeting </span></strong><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12pt; line-height: 107%;\">Connects Officials</span></strong></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>The City of Harper Woods hosted a regional meeting with the Mayors and City Managers of all the Grosse Pointes. The meeting was held at the CCI Center of the Harper Woods School System and guest speakers included Dr. Stephen McGhee, Harper Woods Schools District Superintendent and Wayne County Executive Warren C. Evans.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Breakfast was prepared by the culinary students at the CCI Center with the community leaders discussing regional problems common to all and developing solutions to address those problems. The meeting was a success and enjoyed by all.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\"><span style=\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\">&nbsp;</span></p>', '2023-07-13 19:46:54', '2023-04-11', '2023-12-31', 1),
(15, 'Brightway Insurance - The Sara Shunk Agency', 'Brightway Insurance', 3, 0, 10, 'IMG-6435ac956b3d53.05268542.png', '<p class=\"MsoNormal\"><strong><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Spring Thaw</span></strong></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Heading into the spring season of melting snow and ice, in addition to spring rain, can cause headaches for homeowners.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Water back-ups caused by <span style=\"color: #202124; background: white;\">excess water in the system, along with tree roots in the drain line, pipe deterioration, or the flushing of improper objects can cause major issues.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Water Back-up coverage isn&rsquo;t automatic on a homeowner&rsquo;s policy, and you may or may not be covered.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Opting in for this coverage can save you thousands in repairs.</span><span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #333333; background: white;\">The average cost of water backup and sewer coverage is worth it!<span style=\"mso-spacerun: yes;\">&nbsp; </span>Costs range from $50 to $250 per year, with limits of coverage from $5,000 to&nbsp;$50,000 or more, depending on the carrier. </span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">And while water back-up coverage is an option in a homeowner&rsquo;s policy, Flood coverage is NOT.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Flood Insurance is a separate policy that covers a home when natural waterways flood beyond their natural shorelines.<span style=\"mso-spacerun: yes;\">&nbsp; </span><span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">Got questions?<span style=\"mso-spacerun: yes;\">&nbsp; </span>Contact me! <br>Sara Shunk 586-294-3514 <br>sara.shunk@brightway.com</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\"><span style=\"mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;\">&nbsp;</span></p>', '2023-07-13 19:46:57', '2023-04-11', '2023-12-31', 1),
(16, 'Free Summer Camps', 'Free Summer Camps', 3, 0, 10, 'IMG-6435adb1b1e1e9.68048527.jpg', '<p class=\"MsoNormal\"><strong>Free Summer Camps</strong></p>\r\n<p class=\"MsoNormal\">CARE of Southeastern Michigan is proud to announce its annual free summer camp series. The Leadership Academies and Camp CARE make a positive impact on youth and families through skill building for life success.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">CARE&rsquo;s Leadership Academies enhance the lives of youth by advancing teambuilding, leadership, and success strategies through hands-on activities and guest speakers. The Leadership Academies are for middle school students and will be hosted in Harper Woods, Eastpointe, and Fraser.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">For more than 20 years Camp CARE has served youth and families impacted by a loved one&rsquo;s substance use. Participants are empowered to begin new legacies free from substance use and to thrive in challenging situations. Camp CARE is for youth in preschool through high school.<span style=\"mso-spacerun: yes;\">&nbsp;&nbsp; </span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Additional information regarding the Leadership Academies and Camp CARE can be found on CARE&rsquo;s website at <a href=\"http://www.careofsem.com/events/summer-camps\">www.careofsem.com/events/summer-camps</a></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><span style=\"color: #636466;\">31900 Utica Road, Fraser, MI 48026</span></p>\r\n<p class=\"MsoNormal\"><span style=\"color: #636466;\">586.541.CARE</span></p>', '2023-07-13 19:46:59', '2023-04-11', '2023-12-31', 1);
