(19, 'Bereaved Parents', 'Bereaved Parents of the USA is a national non-profit and self-help group that offers support, understanding, compassion and hope to bereaved parents, siblings or grandparents struggling to rebuild their lives after the death of their loved one. ', 3, 0, 7, 'IMG-647a35ef60dc33.68176592.jpg', '<p class=\"MsoNormal\">Bereaved Parents of the USA is a national non-profit and self-help group that offers support, understanding, compassion and hope to bereaved parents, siblings or grandparents struggling to rebuild their lives after the death of their loved one. There are no fees to become a member and all work is done by volunteers at both the national and chapter levels. There are two chapters in Michigan. Bereaved Parents of Macomb meets both virtually (via Zoom) and in-person at the Washington Senior Center (57880 Van Dyke, Washington) on the 1<sup>st</sup> Thursday of each month from 7-9, contact Kerry Thomas at 248-425-2999 or <a>neilflyer@yahoo.com</a>. &nbsp;Bereaved Parents of Central Detroit meets in-person at the Greater Grace Temple Church (23500 W. Seven Mile Road, Detroit) on the 1<sup>st</sup> Saturday of each month from 12-2, contact Pearl Scott at 313-412-3341.</p>', '2023-07-13 19:47:04', '2023-06-02', '2023-12-31', 1),
(30, 'Why Join Center Lines Exclusive Chamber?', 'From startups to fortune 500 companies, theres value for every business! ', 3, 0, 7, 'IMG-648763aa258739.17524768.png', '<p class=\"MsoNormal\"><strong>From startups to fortune 500 companies, there&rsquo;s value for every business!</strong></p>\r\n<p class=\"MsoListParagraphCxSpFirst\">-&nbsp;<!--[endif]-->Memberships starting at $250 a year</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">- Grow your business through the region&rsquo;s most premier networking group</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">-&nbsp;<!--[endif]-->Grow the visibility of your business and its footprint in the community</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">-&nbsp;<!--[endif]-->Access to free benefits for your employees (401k, health care, Rx prescriptions, etc) with <u>no minimum employer contributions required</u></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">-&nbsp;<!--[endif]-->Government Relations and Public Relations included with membership</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">-&nbsp;<!--[endif]-->The <em>Chamber Connect Program</em> networks on your behalf</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">-&nbsp;<!--[endif]-->Gain access to a vast network of local business owners and decision makers</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">-&nbsp;<!--[endif]-->Secure the best services for your business at discounted prices from verified partners within the Chamber</p>\r\n<p class=\"MsoListParagraphCxSpMiddle\">-&nbsp;<!--[endif]-->Receive municipal bid notifications and assistance</p>\r\n<p class=\"MsoListParagraphCxSpLast\">-&nbsp;<!--[endif]-->Grand openings and re-grand opening ribbon cutting services, with local community leaders and local media coverage</p>\r\n<p class=\"MsoNormal\">Contact:</p>\r\n<p class=\"MsoNormal\">John Long Director of Marketing</p>\r\n<p class=\"MsoNormal\"><a>Long3jm@icloud.com</a></p>\r\n<p class=\"MsoNormal\">586-649-8185</p>\r\n<p class=\"MsoNormal\"><a href=\"http://www.semchamber.org/\">www.semchamber.org</a></p>', '2023-07-13 19:47:07', '2023-06-12', '2023-12-31', 1),
(31, 'Coming Together to Help Children', 'Local nonprofit Susie Qs Kids worked with YMCA representative LaRon Evans and Centerline High School leader ChristineAkroush to provide their youth leadership team with an opportunity to learn It is OK not to be OK, discuss the Four Aspects of Positive Reflections and the power of giving back by creating comfort bags for kids in need in our community.', 3, 0, 7, 'IMG-648764c4bbddc3.48971603.png', '<p class=\"MsoNormal\">Local nonprofit Susie Q&rsquo;s Kids worked with YMCA representative LaRon Evans and Centerline High School leader Christine&nbsp;Akroush to provide their youth leadership team with an opportunity to learn &ldquo;It is OK not to be OK&rdquo;, discuss the Four Aspects of Positive Reflections and the power of &ldquo;giving back&rdquo; by creating comfort bags for kids in need in our community.&nbsp; The students engaged with Dr Mary Welsh, President, Co-founder, and Speaker while assembling 100 comfort bags for foster kids in the Big Family of Michigan program.</p>\r\n<p class=\"MsoNormal\">Susie Q&rsquo;s Kids, a Great nonprofit Top-rated charity, was named the Community Partner of the Year by the American Foundation for Suicide Prevention and shared its message with youth groups, schools, corporate groups, and service organizations.&nbsp; They recently shared their mission with the Centerline Lions Club furthering their reach in our own community.&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\">Susie Q&rsquo;s Kids was founded in honor of the late Susie McBride-Welsh. It furthers the missions of the nonprofits who distribute Susie Q&rsquo;s Kids comfort bags to kids in need in their programs such as hospitals, shelters, foster care, schools, autism centers, refuge centers, advocacy centers, camps, and grief agencies; &nbsp;encourages \"Kids in Helping Kids\" through philanthropy, fundraising, and creating and distributing our comfort bags; and brightens and inspires the lives of kids in need in our community, &ldquo;one comfort bag at a time&rdquo;.&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\">Check out a recent bag stuffing event at Warren Cousino High School <u>https://vimeo.com/792633377</u>&nbsp;&nbsp;Learn more on their website&nbsp;<u>www.susieqskids.org</u>&nbsp;or contact Dr Mary Welsh, President, at&nbsp;<u>drmary@susieqskids.org</u>&nbsp;or call 248-220-6846.&nbsp; The kids in our community need our help, let&rsquo;s make a difference together.</p>', '2023-07-13 19:47:09', '2023-06-12', '2023-12-31', 1),
(32, 'Free Summer Camp Series', ' CAREs Leadership Camp and Camp CARE make a positive impact on youth and families through skill building for life success.', 3, 0, 7, 'IMG-6487659334a219.78795340.jpg', '<p class=\"MsoNormal\">CARE of Southeastern Michigan is proud to announce its annual free summer camp series. CARE&rsquo;s Leadership Camp and Camp CARE make a positive impact on youth and families through skill building for life success.</p>\r\n<p class=\"MsoNormal\">CARE&rsquo;s Leadership Camp enhance the lives of youth by advancing teambuilding, leadership, and success strategies through hands-on activities and guest speakers. The Leadership Academies are for middle school students and will be hosted in Harper Woods, Eastpointe, and Fraser.</p>\r\n<p class=\"MsoNormal\">For more than 20 years Camp CARE has served youth and families impacted by a loved one&rsquo;s substance use. Participants are empowered to begin new legacies free from substance use and to thrive in challenging situations. Camp CARE is for youth in preschool through high school.&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\">Additional information regarding the Leadership Academies and Camp CARE can be found on CARE&rsquo;s website at www.careofsem.com/events/summer-camps</p>', '2023-07-13 19:47:11', '2023-06-12', '2023-12-31', 1),
(41, 'Better Together', 'Co-founder, Dr Mary Welsh shares her belief that We are better together.\" Come out, learn more, and join in this great community service opportunity.', 3, 0, 13, 'IMG-648b242a36b446.31633478.jpg', '<p dir=\"ltr\">Kids are dealing with all kinds of trauma.&nbsp; Susie Q&rsquo;s Kids provides some comfort in an otherwise scary world.&nbsp; They recognize &ldquo;It&rsquo;s OK, not to be OK!&rdquo; They provide hope and healing to kids with health issues, those experiencing homelessness, those in shelters and foster care, kids with Abilities, kids dealing with heavy situations, and those grieving the loss of loved ones.&nbsp; Susie Q&rsquo;s Kids provides comfort bags, bears, and blankets promoting hope and healing. Imagine the smiles of a child receiving our comfort items, so much comfort can be felt from a bear to cuddle, a warm blanket, and a bag of activity and hygiene items.</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Our mission is three-fold:</p>\r\n<p dir=\"ltr\">1. To further the missions of the nonprofits who distribute our comfort bags to kids in need in their programs: hospitals, shelters, foster care, schools, autism centers, refuge centers, advocacy centers, camps, and grief agencies.</p>\r\n<p dir=\"ltr\">2. To encourage &ldquo;Kids in Helping Kids&rdquo;; through philanthropy, fundraising, and creating and distributing our comfort bags.</p>\r\n<p dir=\"ltr\">3. To brighten and inspire the lives of kids in need in our community, &ldquo;one comfort bag at a time.\"</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">Susie Q&rsquo;s Kids is very active in our community and seeks opportunities to network and share their story and impact with service groups, private groups, and youth groups. They share their message of hope and healing following the tragic loss of their daughter Susie. Susie Q&rsquo;s Kids is proud to help address the mental health of our youth and was named the Community Partner of the Year for the American Foundation for Suicide Prevention (AFSP), and advocates for kids in various settings of need.</p>\r\n<p dir=\"ltr\">They recently provided over 17,000 pairs of socks to shelters and foster care agencies throughout our community: Big Family Michigan, Ennis Center for Children, MCrest, Grace Centers of Hope, and Macomb Foster Closet.&nbsp; These organizations support foster care kids and kids fighting homelessness living in shelters in Chesterfield Township and the surrounding community. The Four County Community Foundation Youth Advisory Group created hundreds of comfort bags for eight school districts. Local advocacy agencies received hundreds of comfort bags to augment their programs. The program is expanding quickly trying to meet the need, we need your help!</p>\r\n<p dir=\"ltr\">Dr Mary Welsh, President/Co-founder, partnered with Michigan Real Estate Masterminds (MREM) to share the mission and vision of Susie Q&rsquo;s Kids and their impact in the community.&nbsp; Keith Stonehouse, CEO, supports Susie Q&rsquo;s Kids and their program to engage Real Estate Agents, Mortgagors, Title Agents, Insurers, Inspectors, and others to donate an amount from each home sale towards our program to place comfort bags in the hands of a child in need in our community. Contact Dr Mary to learn more.</p>\r\n<p dir=\"ltr\">Co-founder, Dr Mary Welsh shares her belief that &ldquo;We are better together.\" As President of the Sterling Heights Lions Club, the club generously provides their hall at 12828 Canal Road in Sterling Heights for bag stuffing events on the 2nd Monday of the month. Come out, learn more, and join in this great community service opportunity.&nbsp; In March, they partnered with the Clinton Valley Kiwanis Club to promote collaboration efforts with local service agencies, funders, chambers, nonprofits, and others. It was a smashing success; a room of goodness and connections was experienced. Check out their website to learn more www.susieqskids.org</p>\r\n<p dir=\"ltr\">Susie Q&rsquo;s Kids provided comfort bags to various school districts, hospice agencies, and child advocacy centers recently to improve the outlook of kids experiencing a physical or mental health situation. If your school, church, or youth group is interested in participating in a fundraising or bag stuffing event, please contact President and Co-founder Dr Mary Welsh, drmary@susieqskids.org or 248-220-6846.</p>\r\n<p>&nbsp;</p>', '2023-07-13 19:47:13', '2023-06-15', '2023-12-31', 1),
(43, 'TrueLife Academy: Special-Needs Programs ', 'A non-profit organization looking to expand special-needs programs for Macomb County, Michigan. ', 3, 0, 13, 'IMG-64a84b9b324fc4.24116676.jpg', '<p>TrueLife Academy is a non-profit organization that is tackling a growing need for more services for the special-needs population in Macomb County, Michigan. We plan on undertaking an essential mission to develop a Day Program, as well as, a Residential Housing Program. We wanted to design something that has not been done before in Michigan. Keeping that in mind, our goal is to provide a community space for the day program with the expandability into residential housing, located in one complex.</p>\r\n<p>The community space will be available to the public for the special-needs population, their families, and teachers. Events to the public will include: day passes, school trips, and summer camps. Specialized life skills and vocational training will be provided for groups or individuals by our trained staff. The residential housing will be apartment type units with 24/7 care, with access to indoor and outdoor community space.</p>\r\n<p>Please visit our website at truelifeacademyinc.org for more information.</p>', '2023-07-13 19:47:16', '2023-07-07', '2023-12-31', 1),
(44, 'TrueLife Academy: Special-Needs Programs ', 'A non-profit organization looking to expand special-needs programs for Macomb County, Michigan. ', 3, 0, 20, 'IMG-64a84c02560444.65182718.jpg', '<p>TrueLife Academy is a non-profit organization that is tackling a growing need for more services for the special-needs population in Macomb County, Michigan. We plan on undertaking an essential mission to develop a Day Program, as well as, a Residential Housing Program. We wanted to design something that has not been done before in Michigan. Keeping that in mind, our goal is to provide a community space for the day program with the expandability into residential housing, located in one complex.</p>\r\n<p>The community space will be available to the public for the special-needs population, their families, and teachers. Events to the public will include: day passes, school trips, and summer camps. Specialized life skills and vocational training will be provided for groups or individuals by our trained staff. The residential housing will be apartment type units with 24/7 care, with access to indoor and outdoor community space.</p>\r\n<p>Please visit our website at truelifeacademyinc.org for more information.</p>', '2023-07-13 19:47:18', '2023-07-07', '2023-12-31', 1),
(45, 'Helping Those Affected by Addiction', 'Families Against Narcotics offers programs to help those battling with substance use disorders', 3, 0, 20, 'IMG-64aee5a5867b77.01918757.jpg', '<p>As the number of people dying from drug overdoses continues to increase at an alarming rate, getting individuals who struggle with addiction the help they need is more important, now, than ever before.&nbsp;</p>\r\n<p>That\'s why Families Against Narcotics- also known as FAN- offers multiple programs that can help people find recovery from their substance use disorder. FAN, which is based in Macomb County, has more than 20 chapters across Michigan, and all of the services it provides are free of charge.&nbsp;</p>\r\n<p>Whether it\'s Hope Not Handcuffs, Peer and Family Recovery Coaching, the Stronger Together family and friends support group, or another one of their initiatives, Fan offers compassionate support for both individuals and families affected by addiction.&nbsp;</p>\r\n<p>If you or a loved one is battling addiction, reach out to FAN. They know what you\'re going through, they care, and they can help.</p>\r\n<p>For more information, call 586-438-8500, or visit www.familiesagainstnarcotics.org&nbsp;</p>', '2023-07-13 19:47:20', '2023-07-12', '2023-12-31', 1);

