(12, '', 21, 12, '', '(616) 315-0166', 'slukoskie@qckinetix.com', 'https://qckinetix.com/lansing/', NULL, NULL, NULL, 'At QC Kinetix (Lansing), we provide non-surgical regenerative medicine treatments for joint pain in Lansing, MI, and surrounding areas. In addition to knee replacement and hip replacement complications, many of our patients suffer from shoulder pain, elbow pain, wrist pain, heel pain, joint pain treatments, and sports injuries necessitating treatment with physiotherapy. Our biologic therapies can help you reduce or eliminate your pain to be as active as possible again. We are committed to offering the best in non-surgical orthopedic solutions. Our facility is fully equipped with state-of-the-art technology, and industry experts highly train our staff in several therapies that can be used alone or in combination to help alleviate your pain and improve your quality of life. We offer a free consultation for anyone looking for an alternative solution to surgery for joint pain. If you live in Lansing or the surrounding areas or looking for regenerative medicine in Lansing, you can search for regenerative medicine in Lansing on the internet.\r\n\r\n', 'IMG-62bd646306bdb7.39461275.jpg', '2023-02-10 20:30:07', 0),
(14, '', 21, 5, '', '3135566720', 'plantlifeonly@gmail.com', 'Plantlifeonly', NULL, NULL, NULL, '', '', '2023-02-10 20:30:07', 0),
