(25, 'Drive Creative Services', 2, 2, '31022 Moceri Cir. Warren MI, 48088', '586-275-0030', 'info@drivecreativeservices.com', 'https://www.drivecreativeservices.com/', 'https://www.facebook.com/DriveCreativeServices/', 'https://www.instagram.com/drivecreativeservices/', 'https://www.linkedin.com/company/drive-creative-services/', 'We bring more than 40 years of combined experience encompassing marketing, advertising, graphic arts, sales, company branding, community engagement and team management throughout the tri-county area. Aligned with our strategic network of Michigan-based partners, we offer our clients top-quality consulting, creative graphic arts and materials at an affordable price. All of us at Drive Creative Services understand that operating a business in todays fast-paced world has many challenges. This can be a daunting task, to say the least. With such a variety of advertising platforms available, your marketing dollars could be at risk unless you have a strong, strategic plan set in place for your business.', 'IMG-64089ee5234bd4.79049966.png', '2023-03-08 14:42:45', 0),
(26, 'Antonelli Financial Advisors', 3, 3, '16824 Kercheval Pl Suite 202, Grosse Pointe, MI 48230', '313-290-2602', 'santonelli@antonelliadvisors.com', '', '', '', 'https://www.linkedin.com/company/antonelli-financial-advisors/about/', 'At Antonelli Financial Advisors we understand building a solid investment plan begins with clearly defined goals. Through discretionary investment management and wealth advisory services, we will create a portfolio that will assist in achieving your financial needs and investment objectives. We offer fee-only services tailored to each clients individual financial and investment objectives to best ensure a thorough understanding of how to better assist our clients. \r\n\r\nOur specialities include: Wealth Planning, Retirement Planning, Tax Planning, Strategic, Investment Management, Behavioral Finance, Evidence Based Investing, Charitable Giving, Legacy Planning, Family Office, and Asset Allocation.', 'IMG-6408a0f6d5a7f4.53575451.png', '2023-03-08 14:51:34', 1),
(27, 'Clovers Collision', 5, 5, '17285 Stephens Rd Eastpointe, MI 48021', '586-498-9097', '', 'https://cloverscollision.net/contact/', 'https://www.facebook.com/cloverscollision', '', 'https://www.linkedin.com/company/clovers-collision-and-mechanical-repair/about/', 'Located in Eastpointe, Michigan, We provide honest, fast, and affordable auto body and collision repair services. We strive to achieve complete customer satisfaction, and we have earned a solid reputation for providing reliable, high-quality services. Our large facility features the best equipment on the market to help our factory-trained specialists provide you with fast, high-quality auto body repair services. We easily restore your car back to precise factory specifications. Our goal is returning your vehicle to a safe operating condition and making it look just as good as it did the day you bought it. In addition, every vehicle leaves our shop washed and vacuumed What a great benefit.\r\n\r\n\r\nOur services include: Custom Painting, Auto Restoration, Brakes Services, Spray In Bedliners, Windshields & Glass Replacement, Struts & Shocks, Tie Rods & Sway Bar End Links, Tires, and Detailing Services.\r\n', 'IMG-6408a20a1c2cb9.29425106.png', '2023-03-08 14:56:10', 1),
(29, 'Mr. Furnace', 10, 9, '20220 Stephens Rd St Clair Shores, MI 48080', '586-777-6666', '', 'https://mrfurnace.com/contact-us', 'https://www.facebook.com/Mr.Furnace', 'https://www.instagram.com/mrfurnacemi/', '', 'Located in St. Clair Shores, we offer a comprehensive suite of heating and cooling services. We pride ourselves on our teamwork and focus our efforts on your total satisfaction. Our certified technicians maintain the highest degree of industry training to deliver the best heating service and installation expertise in Michigan. \r\n\r\nWe offer free estimates with 24-hour emergency service for our customers. All of our work is backed by a satisfaction guarantee*, and we take pride in maintaining your home heating and cooling to keep you and your family comfortable all year round. Our projects are quoted accurately and the work is always completed on time, without cost overruns or hidden extras.\r\n\r\nOur services include: Heating Repairs, Air Handlers, Furnace Installations, Boilers, Heat Pumps, Ductless Heating (mini-splits), Unico Small Duct Systems, Zoned Damper Systems, Maintenance Programs, UV Air Filtration, Water Heaters, Air Conditioners, Air Conditioning Repairs, and Ductless AC (mini-splits). \r\n\r\n', 'IMG-6408a4ea68a779.79768539.png', '2023-03-08 15:08:26', 1),
(30, 'Nations Insurance', 6, 10, '19254 Kelly Rd, Harper Woods, MI 48225', '313-521-3500', 'nationsinsurance@aol.com', 'https://www.progressiveagent.com/local-agent/michigan/harper-woods/nations-insurance-agency/?utm_source=google&utm_medium=local&utm_campaign=google-local-95563', 'https://www.facebook.com/NationsInsuranceAgency', 'https://www.instagram.com/nationsinsuranceagency/', '', 'At Nations Insurance Agency, a progressive agent, our agents dont work for just one company; instead, they sell insurance from multiple companies. Ensuring you have an expert to find you the best policy and savings. As your needs change, your agent will be there to make sure you have the right protection. \r\n\r\nOur services include: Car Insurance, Home Insurance, Boat Insurance, Commercial Insurance, and Business Insurance.\r\n', 'IMG-6408a76d093cb0.57079142.png', '2023-03-08 15:19:09', 1),
(31, 'Oakland Mall', 11, 11, '412 W. 14 Mile Road Troy, MI 48083', '248-585-6000', 'lbaker@oaklandmall.com', 'https://www.oaklandmall.com/', 'https://www.facebook.com/OaklandMall', 'https://www.instagram.com/the_oakland_mall/', 'https://www.linkedin.com/company/oakland-mall/about/', 'Located in Troy, Oakland Mall is a regional shopping center with a family-friendly atmosphere including a wide variety of stores. Need to get your steps in? Welcome Oakland Mall as your walking grounds during the winter months! Home of the Giggle Gang, an awesome club just for kids 10-years-old and under. Creating an accessible shopping center, making your shopping experience a little easier with Oakland Mall wheelchairs and electric scooters free of charge. Make Oakland Mall your shopping destination for your family and friends.', 'IMG-6408aa1fe93ca2.42439959.png', '2023-03-08 15:30:39', 1),
(34, 'Accurate Pay Systems', 4, 4, '5850 Chase Rd Dearborn, MI 48126', '844-927-7462', 'cmarsh@accupayinc.com', 'https://accupayinc.com/home-2/', 'https://www.facebook.com/accupayinc', 'https://www.instagram.com/accurate_pay_systems/', 'https://www.linkedin.com/company/accurate-pay-systems/', 'APS, Accurate Pay Systems Inc., is a unique Payroll Services provider with customized services for small businesses. As an average, we cater to small businesses ranging from 1-20 employees. All our clients have a local and dedicated payroll processor assigned to their account to ensure the highest level of customer satisfaction while maintaining communication on your business needs as it evolves over time. We offer an online system that is user-friendly and offers an app for both the Administrator and employee access. \r\n\r\nOur services include: Business Insurance, Employee Benefits Services, HR Tools & Resources, Integrations-GLI, Multiple Payroll Platforms, New Business Registration, Past Payroll Tax Discrepancies, Pay-Any-Day, Payroll & Tax Compliance, and Timekeeping & Scheduling. \r\n', 'IMG-6408bdb0949970.67672202.png', '2023-03-08 16:54:08', 1),
(37, 'Grosse Pointe Board of Realtors', 8, 3, '710 Notre Dame St Grosse Pointe, MI 48230', '313-882-8000', 'members@gpbr.com', 'https://www.gpbr.com/', 'https://www.facebook.com/gprealtors', '', 'https://www.linkedin.com/company/grossepointeboardofrealtors/', 'At Grosse Pointe Board of REALTORS (GPBR) we strive to assist members in becoming more productive, profitable, and successful. Established in 1985, GPBR is made up of REALTORS, Corporate Partners, and Affiliates with a membership of more than 1,400 individuals. We exist to assist members in reaching their goals by providing professional services and education to our members and to the public, to ensure high ethical standards, and to promote community awareness of real property issues and equal opportunity in housing. In addition to our member services, we strive to give back to the community by getting involved with projects that support growth and development, collaboration with local governments and schools, charitable work through donation collection, spreading awareness, and other fundraising efforts. Such as, collaboration with Guardian Angels Medical Service Dogs, a non-profit organization that trains and pairs service dogs to those in need.', 'IMG-6408be8feb0e92.05156093.png', '2023-03-08 16:57:51', 1),
(38, 'Gopspsondal', 22, 15, '', '89436343871', 'gopspso@po123.s3.lolekemail.net', 'http://gjgjgjgdgs.com', 'Adam Sepe', 'Seriously', 'http://gjgjgjgdgs.com', '', '', '2023-03-19 06:57:25', 0),
(39, 'Priebe Mechanical', 10, 16, '31125 Kendall, Fraser, MI 48026', '586-293-6883', 'bill@priebemechanical.com', 'https://www.priebemechanical.com/?fbclid=IwAR0j0WbrHmxc9-PDXRmrJ6PVP9ScHbQquGai48NebZn-UQGksV88Z9rsX3M', 'https://www.facebook.com/priebehvac/', '', 'https://www.linkedin.com/in/william-priebe-838b5712/`', 'Since 1989, Wm. Priebe Mechanical has been Macomb Countys answer to Michigans weather. We are a fully licensed and insured company, certified by the Rheem Manufacturing Company to install their entire line of equipment. We also have our National Refrigerant Certification which enables us to handle and deliver all refrigerants. \r\nThe staff at Wm. Priebe Mechanical desire to provide top notch installation and service with the industries best products and information to all of our clients. This includes finding you ways to cut your utility costs. In building relationships that last, we believe in partnership loyalty and look forward to providing prompt reliable service for your everyday needs. Our company is also green-friendly. By using products that have a higher efficiency we can help to reduce the carbon by-products of combustion.\r\nOur companys mission is to make you comfortable wherever you may be. We understand your needs. By combining our knowledge and skill in the industry along with gathering vital information from you; we are confident that we can meet your home or business heating and cooling needs.\r\nOur services include: HVAC Systems, Refrigerants, Air-Conditioning Systems, Finances, Air Quality Products, Boilers, and more!\r\n', 'IMG-64231a70295163.81054063.png', '2023-03-28 16:48:48', 1),
(41, 'Main Street Bicycles', 23, 17, '102 S Broadway St, Lake Orion, MI 48362', '248-236-9100', '', 'https://www.mainstreetbicycles.com/', 'https://www.facebook.com/mainstreetbicycles/', 'https://www.instagram.com/mainstreetbicycles/?hl=en', 'https://www.linkedin.com/company/main-street-bicycles/about/', 'Main Street Bicycles is an actively involved member of the tri-county cycling community.  Check our Facebook Page for more information regarding shop rides, classes and community events. We hope to make you feel welcome inside our doors and to promote a fun, safe biking community for all.\r\nWeve been there and done it, whether on trails, road, racing or touring. We love two-wheeled miles, were here to support you in yours.  Stop in and share your latest adventure, a cruise or a crash, one of us can relate. Maybe we can help you enjoy the next spin of your wheels even more or encourage a speedier recovery if youve laid it out.\r\nWhen you ride with us, or ride alone, we will make sure you have everything you need for the riding experience you desire. Youll find us right there with you offering a draft when you need it or sitting in yours when you dont.\r\n', 'IMG-64231cfa6daf91.70800058.png', '2023-03-28 16:59:38', 1),
(42, 'Farm Bureau Insurance - Colleen Dyer Agency', 6, 6, '21142 Mack Ave Grosse Pointe Woods, MI 48236-1044', '313-884-2695', '', 'https://new.michfb.com/insurance/find-an-agent/colleen-dyer-21142-mack-ave', 'https://www.facebook.com/100063532694643/wall/', '', 'https://www.linkedin.com/in/colleen-dyer-7400042a/', 'I am a licensed, multi-line insurance agent, which means I can meet all your insurance needs. With me as your agent, you can make just one phone call and I will handle your entire insurance program. Knowing you have the right insurance agent handling all your insurance needs is one of the most secure feelings you can have. My goal is to bring you peace of mind and to help you and your family through the toughest times of your life. I have made a commitment to serve the local community and I have made a commitment to always increase my professional knowledge so that I can better serve my clients. I am proud of my involvement in continuing education. It is part of my overall commitment to provide the best possible insurance service to you, your family, and your community.', 'IMG-642321d0d746d4.00977016.png', '2023-03-28 17:20:16', 1),
(43, 'Wayne County Community College District', 24, 18, '801 W Fort St, Detroit, MI 48226', '313-496-2600', '', 'https://www.wcccd.edu/', 'https://www.facebook.com/wcccdistrict/', 'https://www.instagram.com/wcccd_district/', 'https://www.linkedin.com/school/wayne-county-community-college-district/', 'Wayne County Community College Districts mission is to empower individuals, businesses, and communities to achieve their higher education and career advancement goals through excellent, accessible, culturally diverse, and globally competitive programs and services.\r\nWayne County Community College District will be known as a premier community college and innovator in the areas of high quality academic and career education, talent development in support of regional economic growth, diversity and inclusion, and technological advancement.\r\nWayne County Community College Districts Values are:\r\n1. Supporting Excellence in Teaching and Learning\r\n2. Honoring Diversity\r\n3. Serving the Common Good\r\n4. Being Accountable\r\n5. Operating with Integrity\r\n', 'IMG-6423252a4ea4c8.15639714.png', '2023-03-28 17:34:34', 1),
(44, 'Orb Solutions', 2, 19, '29201 Telegraph Rd Suite 611 Executive Office 3, Southfield, MI 48034', '313-487-8866', '', 'https://orb.solutions/', 'https://www.facebook.com/theorbsolutions', 'https://www.instagram.com/orbsolutions/?hl=en', 'https://www.linkedin.com/company/orb-tehnology-solutions/', 'ORB Solutions mission is to flip the script on this industry. To provide the right solutions and technologies for each businesses specific needs. To instill the hard-learned lessons that we learned through our failures. To ensure contractors and business owners truly had a partner in the marketing and technology arena that they could trust and turn to. We specialize in Highly Specialized Digital Marketing and Technology Services for Construction Businesses, Contractors, and Small-Mid Sized Businesses.', 'IMG-64232668200819.59235024.png', '2023-03-28 17:39:52', 1),
(45, 'Brightway Insurance - Sara Shunk Agency', 6, 20, '75 N Main Street Suite 200 Mt. Clemens, MI 48043', '586-840-2070', 'sara.shunk@brightway.com', 'https://www.brightway.com/agencies/MI/Detroit-Harrison-Township/0364', 'https://www.facebook.com/BrightwayTheSaraShunkAgency', '', '', 'Brightway, The Sara Shunk Agency, is not your typical independent insurance agency. Were a Brightway agency, which means we have relationships with many insurance companies and can offer you expert advice as well as more choice than any other independent agent. Getting started with us is simple: well ask you about you, your family and your needs, and use our insurance expertise to build you a customized policy that will provide the coverages you need at a price you want.\r\nServices include: Property Insurance- Home, Flood, Condo, Renters, and Personal Articles; Vehicle Insurance- Auto, Motorcycle, RV, and Boat; Other Insurance- Business, Life, and Umbrella. ', 'IMG-642329ddd40ec9.80604510.png', '2023-03-28 17:54:37', 1),
