(50, 'Susie Qs Kids', 25, 2, '13116 Iowa Drive Warren, MI 48088', '2482206846', 'drmary@susieqskids.org', 'www.susieqskids.org', '', '', '', 'Susie Qs Kids provides comfort bags to kids in need:  sick kids battling an illness, foster kids adapting to a new life, kids in shelters feeling safe, trafficked and bullied kids finding peace, autistic kids exploring new ideas, grieving kids learning to cope with their loss, and suicidal kids finding the hope to continue on. Each bag provides a soft bear to cuddle, a fuzzy blanket to stay warm, hygiene items to refresh them as they start their new day, inspirational items to motivate them, and journals, coloring books, crayons, games, to make the moments easier to manage.', 'IMG-6494876881e7c8.44763299.png', '2023-06-20 16:14:30', 1),
(51, 'TrueLife Academy', 25, 13, '50547 East Shamrock', '586-405-1468', 'florkaj12@gmail.com', 'https://www.truelifeacademyinc.org', '', '', '', 'TrueLife Academy is a non-profit organization that is tackling a growing need for more services for the special-needs population in Macomb County, Michigan. Our mission is to encourage and support young adults with disabilities to unlock their full potential through respect, dignity, and community integration. With the overall achievement of being able to make their own life choices and enhance the quality of their lives. Through the growth of each individual, their distinct character matures and allows them to overcome obstacles, gain inner confidence, and contribute to society as qualified and successful adults. ', 'IMG-64a8442ef08dd1.91486751.jpg', '2023-07-07 16:58:22', 1);

