(8, 'Roseville-Eastpointe Recreation Authority', 'recauthority@rare-mi.org', '5864455480', '18185 Sycamore St', '', 'Roseville ', 'MI', 48066, 'Family & Friends Nerf Wars', '<p dir=\"ltr\"><strong>WEDNESDAY, JULY 19TH @ 6pm-8pm</strong></p>\r\n<p dir=\"ltr\">AGES 5+</p>\r\n<p dir=\"ltr\">Bring out the whole family for an epic nerf battle!</p>\r\n<p dir=\"ltr\">Each participant will be provided with a nerf gun, safety glasses, and ample ammo to take down the opposing team! We will have various barricades set up so you can be sneaky with your shots.</p>\r\n<p dir=\"ltr\">Refreshments and snacks will be provided.</p>\r\n<p dir=\"ltr\">*If there is inclement weather, event will be held indoors*</p>\r\n<p dir=\"ltr\"><strong><span style=\"text-decoration: underline;\">FEES</span></strong></p>\r\n<p dir=\"ltr\">Resident: $10 per person</p>\r\n<p dir=\"ltr\">Non-Resident: $15 per person</p>\r\n<p>&nbsp;</p>', '2023-07-19', '2023-07-19', 'https://fb.me/e/4s0vDqSLU', 8, '2023-06-29 19:30:53', 1),
(10, 'Farmers Market', 'mcfarmersmarket@gmail.com', '586-493-7600', '141 North River Road ', '', 'Mount Clemens', 'MI', 48043, 'Mount Clemens Farmers Market', '<p><strong>Saturday, July 1st @ 7am-1pm</strong></p>\n<p><span style=\"text-decoration: underline;\"><strong>Mount Clemens Farmer\'s Market- Happy Independence Day!</strong></span></p>\n<p>Come check out the Farmer\'s Market in Mount Clemens for fresh food options!</p>\n<p>Every Saturday until November 18th!</p>\n<p>&nbsp;</p>\n<p><span style=\"text-decoration: underline;\"><strong>Fun Fact:</strong></span> Did you know that agriculture layed an important role in winning the Revolutionary War?</p>\n<p>American farmers helped to feed the America Forces and our important export commodities helped build alliances with other nations.&nbsp;</p>\n<p>The Farmers\' of the Mount Clemens Market would like to still be of service and help you have the freshest cook out this weekend.&nbsp;</p>\n<p>Come see us at the market on Saturday, July 1st for everything you need.&nbsp;</p>', '2023-07-01', '2023-07-01', 'https://www.facebook.com/MountClemensFarmersMarket', 20, '2023-06-29 20:38:39', 1),
(12, 'Mount Clemens Public Library', 'info@mtclib.org', '586-469-6200', '150 Cass Avenue', '', 'Mount Clemens', 'MI', 48043, 'Mount Clemens Public Library- Yoga with Del', '<p><strong>Thursday, July 6th @ 6:45pm-7:30pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Mount Clemens Public Library- Yoga with Del</strong></span></p>\r\n<p>Our next FREE Yoga class with Del is a 45 minute session.</p>\r\n<p><em>Practice mindfulness with us while increasing your strength, balance, flexibility, and more. </em></p>\r\n<p><strong>Registration is not required. </strong></p>\r\n<p><strong>Please bring a yoga mat with you!</strong></p>', '2023-07-06', '2023-07-06', 'https://www.facebook.com/events/158553823890097', 20, '2023-06-30 15:57:44', 1),
(13, 'Macomb Family YMCA', 'gowanie@comcast.net', '586-468-1431', '24770 S River Rd', '', 'Mount Clemens', 'MI', 48043, '45th Annual Macomb Family YMCA Golf Classic', '<strong>45th Annual Macomb Family YMCA Golf Classic</strong></span></p>\r\n<p>The Annual Macomb Family YMCA Golf Classic is back! </p>\r\n<p>We look forward to your support as we bring our outing back to the Macomb community. </p>\r\n<p>Change lives and inspire hope!</p>\">\r\n', '2023-08-14', '2023-08-14', 'gowaniegc.memberstatements.com/tour/tours.cfm?tourid=72870', 20, '2023-07-05 14:51:55', 1),
(14, 'Farmers Market', 'mcfarmersmarket@gmail.com', '586-493-7600', '141 North River Road ', '', 'Mount Clemens', 'MI', 48043, 'Mount Clemens Farmers Market', '<p><strong>Saturday, July 8th @ 7am-1pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Mount Clemens Farmer\'s Market</strong></span></p>\r\n<p>Come check out the Farmer\'s Market in Mount Clemens for your fresh food options!&nbsp;</p>\r\n<p>Every Saturday until November 18th!</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2023-07-08', '2023-07-08', 'www.mountclemensfarmersmarket.com', 20, '2023-07-05 15:12:21', 1),
(15, 'Macomb Family YMCA', 'macombymca@ymcadetroit.org', '586-468-1411', '10 North River Road', '', 'Mount Clemens', 'MI', 48043, 'Detroit Swims- Safety Around Water- Metroparks', '<p><strong>Meetings start July 24th thru July 28th</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Detroit Swims- Safety Around Water- Metroparks-Macomb Family YMCA</strong></span></p>\r\n<p>Detroit Swims and Huron-Clinton Metroparks are partnering to provide swim lessons to Macomb County Participants.</p>\r\n<p>Students will receive 5 Safety Around Water swim lessons.</p>\r\n<p>Each class is 45 minutes. Class will meet Monday thru Friday.</p>\r\n<p>Participants must be ages 5-14 years of age and live in the follow zip codes to qualify: <strong>48043, 48035, 48036, 48026, 48066, 48021</strong></p>\r\n<p><strong>Please register with the link provided. All slots are first come, first serve basis.&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\">Meetings: Jul 24 2023 to Jul 28 2023</span></p>\r\n<p>Each Monday from 4:00pm to 4:45pm</p>\r\n<p>Each Tuesday from 4:00pm to 4:45pm</p>\r\n<p>Each Wednesday from 4:00pm to 4:45pm</p>\r\n<p>Each Thursday from 4:00pm to 4:45pm</p>\r\n<p>Each Friday from 4:00pm to 4:45pm&nbsp;</p>\r\n<p>&nbsp;</p>', '2023-07-24', '2023-07-28', 'https://www.activekids.com/mount-clemens-mi/water-sports/swimming-classes/detroit-swims-safety-around-water-metroparks-2023-92041788#:~:text=Macomb%20Family%20YMCA-,REGISTER%20NOW,-Pricing', 20, '2023-07-05 15:38:48', 1),
(16, 'Brandenburg Park', 'bkersten@chesterfieldtwp.org', '586-949-0400', '50050 Jefferson Ave', '', 'Chesterfield', 'MI', 48047, 'Outdoor Concert Series- Brandenburg Park ', '<p><strong>Reoccuring Thursdays, August 3, 10, 17, 24, 2023 @ 6:00pm-8:30pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Outdoor Concert Series- Brandenburg Park</strong></span></p>\r\n<p>Bring your lawn chairs out for Brandenburg Park\'s outdoor concert series- FREE</p>\r\n<p>August 3rd is Sonic Freeway.</p>\r\n<p>August 10th is Swift Brothers.</p>\r\n<p>August 17th is Meldrum Brothers.</p>\r\n<p>August 24th is Bandwagon.</p>\r\n<p><strong>Age Recommendation: </strong>Early Elementary (K-3), Late Elementary (4-5), Preschool, Teens, Toddlers, and Tweens</p>\r\n<p>&nbsp;</p>', '2023-08-03', '2023-08-03', 'www.chesterfieldtwp.org', 13, '2023-07-05 16:50:35', 1),
(17, 'Brandenburg Park', 'bkersten@chesterfieldtwp.org', '586-949-0400', '50050 Jefferson Ave', '', 'Chesterfield', 'MI', 48047, 'Outdoor Concert Series- Brandenburg Park', '<p><strong>Reoccuring Thursdays, August 10, 17, 24, 2023 @ 6:00pm-8:30pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Outdoor Concert Series- Brandenburg Park</strong></span></p>\r\n<p>Bring your lawn chairs out for Brandenburg Park\'s outdoor concert series- FREE</p>\r\n<p>August 10th is Swift Brothers.</p>\r\n<p>August 17th is Meldrum Brothers.</p>\r\n<p>August 24th is Bandwagon.</p>\r\n<p><strong>Age Recommendation:</strong> Early Elementary (K-3), Late Elementary (4-5), Preschool, Teens, Toddlers, and Tweens</p>\r\n<p>&nbsp;</p>', '2023-08-10', '2023-08-10', 'www.chesterfieldtwp.org', 13, '2023-07-05 16:59:44', 1),
(18, 'Brandenburg Park', 'bkersten@chesterfieldtwp.org', '586-949-0400', '50050 Jefferson Ave', '', 'Chesterfield', 'MI', 48047, 'Outdoor Concert Series- Brandenburg Park', '<p><strong>Reoccuring Thursdays, August 17, 24, 2023 @ 6:00pm-8:30pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Outdoor Concert Series- Brandenburg Park</strong></span></p>\r\n<p>Bring your lawn chairs out for Brandenburg Park\'s outdoor concert series- FREE</p>\r\n<p>August 17th is Meldrum Brothers.</p>\r\n<p>August 24th is Bandwagon.</p>\r\n<p><strong>Age Recommendation:</strong> Early Elementary (K-3), Late Elementary (4-5), Preschool, Teens, Toddlers, and Tweens</p>\r\n<p>&nbsp;</p>', '2023-08-17', '2023-08-17', 'www.chesterfieldtwp.org', 13, '2023-07-05 17:01:38', 1),
(19, 'Brandenburg Park', 'bkersten@chesterfieldtwp.org', '586-949-0400', '50050 Jefferson Ave', '', 'Chesterfield', 'MI', 48047, 'Outdoor Concert Series- Brandenburg Park', '<p><strong>Reoccuring Thursdays, August 24, 2023 @ 6:00pm-8:30pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Outdoor Concert Series- Brandenburg Park</strong></span></p>\r\n<p>Bring your lawn chairs out for Brandenburg Park\'s outdoor concert series- FREE</p>\r\n<p>August 24th is Bandwagon.</p>\r\n<p><strong>Age Recommendation:</strong> Early Elementary (K-3), Late Elementary (4-5), Preschool, Teens, Toddlers, and Tweens</p>\r\n<p>&nbsp;</p>', '2023-08-24', '2023-08-24', 'www.chesterfieldtwp.org', 13, '2023-07-05 17:03:32', 1),
(20, 'Roseville-Eastpointe Recreation Authority', 'recauthority@rare-mi.org', '5864455480', '29100 Hayes Road', '', 'Roseville ', 'MI', 48066, 'Family Skate Night (Disney Night)', '<p><strong>Thursday, September 28th @ 5:30pm-8:00pm </strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Family Skate Night (Disney Night)- Held at Great Skate- 29100 Hayes Road, Roseville, MI 48066</strong></span></p>\r\n<p>Dress up as your favorite Disney character for a night at Great Skate!</p>\r\n<p>You can be a princess, a villian, or who knows... maybe Olaf from Frozen is your favorite!&nbsp;</p>\r\n<p>With over 2,000 Disney characters, the possibilties are endless!&nbsp;</p>\r\n<p>Each guest receives admission, skate rental, pizza and pop dinner, and a special gift for the family.</p>\r\n<p>We will have a special photo opportunity area, along with a surpirse Disney guest!</p>\r\n<p>Lastly, we will have a mini parade for all those who dressed up to compete in our costume contest! All ages are welcome.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Resident:</strong> $12 per person</p>\r\n<p><strong>Non-Resident:</strong> $14 per person</p>\r\n<p><em><strong>No tickets sold at the doors!</strong></em></p>\r\n<p><strong>REGISTER BY:</strong> Sunday, September 24th</p>', '2023-09-28', '2023-09-28', 'rare-mi.org', 8, '2023-07-05 17:37:02', 1),
(21, 'Roseville-Eastpointe Recreation Authority', 'bkersten@chesterfieldtwp.org', '586-445-5480', '18185 Sycamore St', '', 'Roseville ', 'MI', 48066, 'Very Important Person (VIP) Family Dance', '<p><strong>Friday, December 8th @ 6:30pm-9:30pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Very Important Person (VIP) Family Dance- Held at Recreation Center&nbsp;</strong></span></p>\r\n<p>This is a dance for children, and an important role model in their life, to enjoy a fun night out on the dance floor.</p>\r\n<p>This year\'s theme will be \"<strong>Color Explosion-Glow Style</strong>,\" with an all-new balloon drop at 8:30pm!</p>\r\n<p>&nbsp;</p>\r\n<p>Registration will include a buffet dinner, dancing, a group photo, and a special gift for each child at the end of the night!&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em><strong>This event DOES sell out, register early!</strong></em></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Ticket Prices Per Person</strong></span></p>\r\n<p><strong>Resident:</strong> $20</p>\r\n<p><strong>Non-Resident:</strong> $25</p>\r\n<p><em>Maximum of 180 tickets for event night.&nbsp;</em></p>\r\n<p><em><strong>No tickets sold at the door!</strong></em></p>', '2023-12-08', '2023-12-08', 'rare-mi.org', 8, '2023-07-05 18:11:43', 1),
(22, 'Roseville-Eastpointe Recreation Authority', 'recauthority@rare-mi.org', '5864455480', '24800 Flower Ave', '24998', 'Eastpointe', 'MI', 48021, 'Halloween Doggie Meet-up & Costume Contest!', '<p><strong>Tuesday, October 24th @ 5:30pm-6:30pm&nbsp;</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Halloween Doggie Meet-up &amp; Costume Contest!- Held at MiDog Park, Eastpointe</strong></span></p>\r\n<p><strong>FREE EVENT</strong></p>\r\n<p>Bring your furry friend out to meet some new friends and show off their Halloween costumes.</p>\r\n<p>If you would like to participate in the Halloween costume contest, a picture of your furry friend will be uploaded to Facebook the following day to compete in the contest.</p>\r\n<p>All doggies will receive a goodie bag for attending. There will also be a photo opportunity for you and your pet!</p>\r\n<p><strong><em>If inclement weather, event will be postponed or cancelled. </em></strong></p>\r\n<p>Visit our website, rare-mi.org to find out how to register your dog for the MiDog Park!</p>', '2023-10-24', '2023-10-24', 'www.rare-mi.org', 5, '2023-07-05 18:26:47', 1),
(23, 'Roseville-Eastpointe Recreation Authority', 'recauthority@rare-mi.org', '5864455480', '18185 Sycamore St', '', 'Roseville ', 'MI', 48066, 'A RARE NIGHTMARE', '<p><strong>Friday, October 27th @ 6:00pm-8:00pm&nbsp;</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>A RARE NIGHTMARE!- Held at Recreation Center</strong></span></p>\r\n<p>Bring the family out to the Recreation Authority for some Halloween fun!</p>\r\n<p>&bull; Variety/magic show</p>\r\n<p>&bull; Spooky dance</p>\r\n<p>&bull; Pumpkin patch and decorating</p>\r\n<p>&bull; Ghoulish games and crafts</p>\r\n<p>&bull; Treat Trail Scavenger Hunt Indoors</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Resident</strong>: $10 per person</p>\r\n<p><strong>Non-Resident</strong>: $12 per person</p>\r\n<p><em><strong>Children 2 and under are FREE</strong></em></p>\r\n<p>This event is only successful if we have groups passing out candy for our Treat Trail Scavenger Hunt.</p>\r\n<p>If you are interested in having a table on our Treat Trail to pass out candy, please register by calling (586) 445-5480 or email Sara at sfrederick@rare-mi.org.</p>\r\n<p>This is a great opportunity for local businesses and organizations.</p>\r\n<p><strong>REGISTER BY: </strong>Sunday, October 22nd</p>', '2023-10-27', '2023-10-27', 'www.rare-mi.org', 8, '2023-07-05 18:40:23', 1),
(24, 'Roseville-Eastpointe Recreation Authority', 'recauthority@rare-mi.org', '5864455480', '18185 Sycamore St', '', 'Roseville ', 'MI', 48066, '45th Annual Big Bird Run', '<p><strong>Sunday, November 12th @ 10:00am</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>45th Annual Big Bird Run- 10k (6.2 Miles), 5K (3.1 Miles) and 1 Mile Fun Run</strong></span></p>\r\n<p><strong>Start &amp; Finish Line located at Recreation Center 18185 Sycamore Street, Roseville, MI 48066</strong></p>\r\n<p>The course will include Gratiot Ave., I-696 pedestrian bridge, and several residential streets. All participants in the 10K and 5K will receive a finishing medal and long-sleeve race shirt.&nbsp;</p>\r\n<p>Participants in the 1 Mile Fun Run will reeive a finisher ribbon and a long-sleeve race shirt.&nbsp;</p>\r\n<p>The top overall male and female finishers in the 10K and 5K will receive grand awards. Awards will be given to the top male and female finishers in the 10K and 5K in each division.&nbsp;</p>\r\n<p><em>As always, our famous turkey raffle and prizes are here to stay!</em></p>\r\n<p><em><strong>Registration will be available on rare-mi.org or eastsideracingcompany.com</strong></em></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Registration Fees</strong></span></p>\r\n<p><strong>10K:</strong> $40</p>\r\n<p><strong>5K:</strong> $35</p>\r\n<p><strong>1 Mile:</strong> $25</p>\r\n<p>**<strong>Race Day Fees + $5 Day of Race</strong>, checks will not be accepted, <strong>cash or credit/debit payments only</strong>**</p>\r\n<p>&nbsp;</p>', '2023-11-12', '2023-11-12', 'www.rare-mi.org', 8, '2023-07-05 18:54:21', 1),
(25, 'Bass, Brews & BBQ Festival', 'info@makemacombyourhome.com', '586-469-5100', '50050 Jefferson Ave', '', 'Chesterfield', 'MI', 48047, 'Bass, Brews & BBQ Festival', '<p><strong>Friday, July 28th @ Noon-Midnight</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Bass, Brews &amp; BBQ Festival- Brandenburg Park- 50050 Jefferson Ave. Chesterfield Township, MI 48047</strong></span></p>\r\n<p>Bring your friends and family for a weekend event full of entertainment, food, and festivities!</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Event Schedule</strong></span></p>\r\n<p>Bassmaster Weigh-in @ 3pm</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Bands</strong></span></p>\r\n<p>East Town Band @ 5pm-8pm</p>\r\n<p>Doin Time Band @ 8pm-12am</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Food Trucks</strong></span></p>\r\n<p>Espresso 911 (morning only), V\'s Barista, Big Bo\'s BBQ, Bubba\'s BBQ, Scalici\'s Pizza, Chicken Headz, JJ\'s Fish and Shrimp and Slaw Dogz</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Fireworks at Dusk</strong></span></p>\r\n<p><em><strong>*This Schedule is tentative and subject to change*</strong></em></p>', '2023-07-28', '2023-07-28', 'https://www.facebook.com/events/72421699492741', 13, '2023-07-06 15:22:59', 1),
(26, 'Bass, Brews & BBQ Festival', 'info@makemacombyourhome.com', '586-469-5100', '50050 Jefferson Ave', '', 'Chesterfield', 'MI', 48047, 'Bass, Brews & BBQ Festival', '<p><strong>Saturday, July 29th @ Noon-Midnight</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Bass, Brews &amp; BBQ Festival- Brandenburg Park- 50050 Jefferson Ave., Chesterfield Township, MI 48047</strong></span></p>\r\n<p>Bring your friends and family for a weekend event full of entertainment, food, and festivities!&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Event Schedule</strong></span></p>\r\n<p>Bassmaster Weigh-in @ 3pm</p>\r\n<p>Cornhole Tournament @ 5pm</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Bands</strong></span></p>\r\n<p>Losing Six Band @ 5pm-8pm</p>\r\n<p>The Gobies- 8pm-12am</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Food Trucks</strong></span></p>\r\n<p>Espresso 911 (morning only), J&amp;W Ice Cream on Wheels, Big Bo\'s BBQ, Chicken Headz, JJ\'s Fish and Shrimp and Slaw Dogz</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Fireworks Rain Day</strong></span></p>\r\n<p><em>*<strong>This schedule is tentative and subject to change*</strong></em></p>', '2023-07-29', '2023-07-29', 'https://www.facebook.com/events/72421699492741', 13, '2023-07-06 15:33:37', 1),
(27, 'Bass, Brews & BBQ Festival', 'info@makemacombyourhome.com', '586-469-5100', '50050 Jefferson Ave', '', 'Chesterfield', 'MI', 48047, 'Bass, Brews & BBQ Festival', '<p><strong>Sunday, July 30th @ Noon-5pm</strong></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Bass, Brews &amp; BBQ Festival- Brandenburg Park- 50050 Jefferson Ave., Chesterfield Township, MI 48047</strong></span></p>\r\n<p>Bring your friends and family for a weekend event full of entertainment, food, and festivities!</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Event Schedule</strong></span></p>\r\n<p>Bassmaster Weigh-in @ 3pm</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Bands</strong></span> @ 12pm- Music provided by Bassmaster</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Food Trucks</strong></span></p>\r\n<p>Espresso 911 (morning only), J&amp;W Ice Cream on Wheels, Big Bo\'s BBQ, Chicken Headz, JJ\'s Fish and Shrimp and Slaw Dogz</p>\r\n<p><em><strong>*This schedule is tentative and subject to change*</strong></em></p>', '2023-07-30', '2023-07-30', 'https://www.facebook.com/events/72421699492741', 13, '2023-07-06 15:42:06', 1),
